import React from "react";
import DesignCo from "../assets/images/dco-logo.svg";

function Landing() {
  return (
    <div class="navbar">
      <img src={DesignCo} alt="Design Co Logo" />
      <nav>
        <ul>
          <li>
            <a>Overview</a>
          </li>
          <li>
            <a>Timeline</a>
          </li>
          <li>
            <a>Brief</a>
          </li>
          <li>
            <a>Register</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Landing;
